import './App.css';
import api from "./api"
import Button from 'react-bootstrap/Button'
import Table from 'react-bootstrap/Table'

import React from "react"

function Utils() {

  const data = {
    hostname: "",
    ifname: "",
    macaddr: "",
    name: "",
    version: ""
  }

  function buttonDiscoveryClick() {
    api.getNetworkDiscover(function (res) {
      renderDevices(res)
    })
  }

  function renderDevices(res) {
    return (
      <tr key={res[0].data.hostname}>
        <td>{res[0].data.address}</td>
        <td>{res[0].data.address}</td>
        <td>{res[0].data.address}</td>
      </tr>
    )
  }

  return (
    <>
      <Button variant="primary" onClick={buttonDiscoveryClick}>
        Discovery
      </Button>

      <Table striped condensed hover>
        <thead>
          <tr>
            <th></th>
            <th>Name</th>
            <th>Address</th>
            <th>Age</th>
          </tr>
        </thead>
        <tbody>
          {personArray.map(this.renderPerson)}
        </tbody>
      </Table>

    </>
  )
}

export default Utils;
